import React, { Component } from 'react';
import './App.css';
import Container from './components/Container.js'

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      name: '',
      greeting: ''
    };

  }

 componentDidMount(){

 }

 async Topics() {
     const response = await fetch('/google-trend');
     const body = await response.json();
     console.log(body)
     //this.setState({title:result})
 }

  render() {
    return (
      <div className="App">
        <Container />
      </div>
    );
  }
}

export default App;
